import React from 'react';
import './Header.css';

function Heading() {
  return (
    <div className="Header-Div">
      <div className="Header-Left">
        <img src="./Images/profilePic.png"/>
      </div>
      <div className="Header-Middle">
        <p>GameSearch</p>
      </div>
      <div className="Header-Right">
        
      </div>
    </div>
  );
}

export default Heading;
